(46, 'Calico Fantail Goldfish', 1, 'Koi Fish', '499.00', 'Goldfish are a great starter fish to recommend for ponds and aquariums. The Calico Fantail Goldfish has a white body with markings of red, orange, and black. They have a large, forked caudal tail that is round like a fan. Like most goldfish, the Calico Fantail will get quite large and will need a large aquarium or pond when fully grown.', NULL, 'NO 07 GALLINDAHENA WATTHA NARAWELPITA WEST', '1648400265.9147.jpg', '1648400265.9184.jpg', '1648400265.9202.jpg', '1648400265.9231.jpg', 8, 24, '2022-03-27', 3, '6.9139926', '79.8905391', 1, NULL, '0.00', '0.00', '0.00', '0.36', '0.00', NULL),
(47, 'Drawf gourami', 1, 'Freshwater Fish', '119.00', 'The Dwarf Gourami is one of the littlest and most prominent individual from the Gourami family, which likewise incorporates the Moonlight, Honey and the Three Spot Gourami. Dwarf Gouramis are local Asian fishes.\n\nYou would find them in streams where the water is slow-moving and the substrate has a lot of vegetation. The anal and dorsal blades start in the frontal piece of the body and stretch out almost to the fan-formed caudal balance.\n\nMale Dwarf Gouramis are more beautiful and somewhat bigger than females when developed. A few shading variations have been reproduced however, some of these coloured variants are females as well.', NULL, 'NO 07 GALLINDAHENA WATTHA NARAWELPITA WEST', '1648221234.5482.jpg', '1648221234.5534.jpg', '1648221234.5585.jpg', '1648221234.5643.jpg', 12, 20, '2022-03-25', 3, '6.9139926', '79.8905391', 4, NULL, '0.00', '0.00', '0.00', '0.21', '0.00', NULL),
