(49, 'Golden Ram Cichlid', 1, 'Saltwater Fish', '95.00', 'The German Gold Ram Dwarf Cichlid (Mikrogeophagus ramirezi var. “Gold”) is a striking variant of the ever-popular German Blue Ram Dwarf Cichlid. It has an overall bright yellow/gold coloration that is adorned with neon blue and red highlights across many areas of its body.The German Gold Ram is a beautiful color variation of Mikrogeophagus ramirezi. It is a social fish that will form pairs and often remain \"faithful\" to each other. German Gold Rams have a gold body with hints of pink, orange, and red.\nThe blue ram, Mikrogeophagus ramirezi, is a species of freshwater fish endemic to the Orinoco ... These include numerous xanthistic forms, known as gold rams or electric blue , along with larger, high-bodied, fattened \"balloon\" forms', NULL, 'NO 07 GALLINDAHENA WATTHA NARAWELPITA WEST', '1648221471.6874.jpg', '1648221471.6892.jpg', '1648221471.6925.jpg', '1648221471.6945.jpg', 12, 16, '2022-03-25', 3, '6.9139926', '79.8905391', 4, NULL, '0.00', '0.00', '0.00', '0.10', '0.00', NULL),
